import React, { Component, Fragment} from 'react'

import Drawer from '@material-ui/core/Drawer'
import Fab from '@material-ui/core/Fab'
import MenuIcon from '@material-ui/icons/Menu'
import Button from '@material-ui/core/Button';
import List from '@material-ui/core/List'
import Badge from '@material-ui/core/Badge';
import Divider from '@material-ui/core/Divider'
import ListItem from '@material-ui/core/ListItem'
import ListItemIcon from '@material-ui/core/ListItemIcon'
import ListItemText from '@material-ui/core/ListItemText'
import Avatar from '@material-ui/core/Avatar'
import Chip from '@material-ui/core/Chip';

import ContactMailIcon from '@material-ui/icons/ContactMail';
import ContactPhoneIcon from '@material-ui/icons/ContactPhone';
import ExitToAppIcon from '@material-ui/icons/ExitToApp'
import DirectionsBikeSharpIcon from '@material-ui/icons/DirectionsBikeSharp';
import HomeIcon from '@material-ui/icons/Home'
import EmailSharpIcon from '@material-ui/icons/EmailSharp'
import FaceIcon from '@material-ui/icons/Face';

class loading extends Component {
  constructor(props) {
    super(props)
    this.state = { 
      drawerIsOpen:false,
    }
  }

  render() {
    let menu = null

    if(this.props.user == null)
    {
      menu = {

      }
    }
    else
    {
      menu = (
        <div style={{width:"250px", height:"100%", position:"relative"}}>
          <Avatar alt="Remy Sharp" src="/noProfilePicture.svg" style={{width:'100px', height:'100px', marginLeft:'auto', marginRight:'auto', marginTop:'20px', marginBottom:"20px"}}/>
          <p style={{textAlign:'center'}}>{this.props.user.name}</p>
          <p style={{textAlign:'center'}}>
            <small>
              <span style={{
                display: 'flex',
                alignItems: 'center'
              }}>
                <ContactPhoneIcon size="small"/> {this.props.user.cellphone}
              </span>
                          <br></br>
                          <span style={{
                display: 'flex',
                alignItems: 'center'
              }}>
                <ContactMailIcon size="small"/> {this.props.user.email}
              </span>
            </small>
          </p>
          <Chip
            variant="outlined"
            size="small"
            avatar={<Avatar>M</Avatar>}
            label="Cambiar"
          />
          <div style={{marginRight:'auto', marginLeft:'auto', marginTop:'10px', marginBottom:'10px'}}>
            <Button
              size="small" 
              variant="contained"
              color="secondary"
              startIcon={<ExitToAppIcon />}
            >
              Cerrar sesi√≥n
            </Button>
          </div>
          <Divider />
          <List>
            <ListItem button>
              <ListItemIcon>
                <Badge badgeContent={4} color="primary">
                  <DirectionsBikeSharpIcon />
                </Badge>
              </ListItemIcon>
              <ListItemText primary='Pedidos' />
            </ListItem>
          </List>
          <Divider />
          <List style={{position:'absolute', bottom:'0', left:'0'}}>
            <ListItem button>
              <ListItemIcon><HomeIcon /></ListItemIcon>
              <ListItemText primary='Acerca de nosotros' />
            </ListItem>
          </List>
        </div>
      )
    }

    return (
      <div>
        <Fab size="small" aria-label="menu" onClick={() => this.setState({drawerIsOpen:true})} style={{position:"fixed", top:"15px", left:"15px"}}>
          <MenuIcon />
        </Fab>
        <Drawer anchor='left' open={this.state.drawerIsOpen} onClose={()=>this.setState({drawerIsOpen:false})}>
          {menu}
        </Drawer>

        {this.props.children}

      </div>
    )
  }
}

export default loading;
